    <PositionCard
      address={`${product.category1} > ${product.category2} > ${product.category3} > ${product.category4}`}
      title={noTags(product.title)}
      desc={`최저가 ${numberWithCommas(product.lprice)}원`}
      url={""}
      img={product.image}
      onClick={() => {}}
    />
  );
};
